        <div className="titleBody"><h1>Hidup Sehat dengan Buah-Buahan</h1></div>
            <img position="background" width="100%" height="fit-content" className="body" src="https://images.unsplash.com/photo-1580062760649-1250019c0623?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=750&q=80"></img>
        </div>
        </>
        );
    }
}
export default Body;
